import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "../firebase.js"

export default function Homepage() {
    const signOut = () => {
        signOut(auth).catch(err => {
            alert(err.message);
        });
    }
    return (
        <div>
            <h1>Homepage</h1>
            <button>Sign Out</button>
        </div>
    )
}
